import React from 'react'
import { AboutUs } from './AboutUs'
import { ContactUs } from './ContactUs'

export const Footer = () => {
  return (
    <div>
        <section className="footer">
            <AboutUs />
            <ContactUs />
        </section>
    </div>
  )
}
